import React from 'react'
import './intro.css';

const intro = () => {
  return (
    <section id="intro">
        <div className="introContent">
            <span className="hello">Hello</span>
            <span className="introText">I'm <span className="introName">Pukar Singh Pundir</span><br>working on Web Development</br></span>

        </div>
        <img src="background.png" alt="" className="bg" />
    </section>
  )
}

export default intro
